import styled from 'styled-components';

const Button = styled.button`
	padding: 10px 15px;
	color: #00d1b2;
	background-color: #fff;
	border: 2px solid #00d1b2;
	border-radius: 5px;
	box-shadow: none;
	outline: none;
	cursor: pointer;
	&:hover {
		color: #fff;
		background-color: #00d1b2;
	}
`;

export default Button;
